// SpSideNavbar.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import './SPSideNavbar.css';

const SpSideNavbar = () => {
  return (
    <div className="sp-side-navbar">
      <NavLink to="/spdashboard" activeClassName="active-link">
        Home
      </NavLink>
      <NavLink to="/upcoming-bookings" activeClassName="active-link">
        Upcoming Bookings
      </NavLink>
      {/* <NavLink to="/ongoing-bookings" activeClassName="active-link">
        Ongoing Bookings
      </NavLink>
      <NavLink to="/completed-bookings" activeClassName="active-link">
        Completed Bookings
      </NavLink>
      <NavLink to="/update-booking" activeClassName="active-link">
        Update Booking
      </NavLink>
      <NavLink to="/add-service" activeClassName="active-link">
        Add Service
      </NavLink>
      <NavLink to="/modify-service" activeClassName="active-link">
        Modify Service
      </NavLink>
      <NavLink to="/delete-service" activeClassName="active-link">
        Delete Service
      </NavLink> */}
    </div>
  );
};

export default SpSideNavbar;
